  "text" : "\" \u2018\uADF8\uB7F0 \uB9D0\u2019\uC740 \uC544\uD508 \uC774\uB4E4\uC5D0\uAC8C \uC5B4\uB5A4 \uC601\uD5A5\uC744 \uBBF8\uCE60\uAE4C? \uC544\uD508 \uBAB8\uC740 \uC774\uBBF8 \uC9C8\uBCD1\uACFC \uCE58\uB8CC \uACFC\uC815\uC5D0\uC11C \uC2E4\uB9DD, \uACE0\uD1B5, \uBB34\uB825\uC744 \uACBD\uD5D8\uD558\uACE0 \uC788\uB2E4. \uB098\uC758 \uACBD\uC6B0 \uC544\uD504\uACE0 \uB098\uC11C \uB0B4 \uBAB8\uC774 \uD3B8\uC548\uD558\uAC8C \uB290\uAEF4\uC9C4 \uC801\uC774 \uAC70\uC758 \uC5C6\uB2E4. \uC77C\uC0C1\uC5D0\uC11C \uACC4\uC18D \uBAB8\uC744 \uC758\uC2DD\uD558\uAC8C \uB41C\uB2E4.\"",
